/* harmony default export */ __webpack_exports__["default"] = ("<mat-card style=\"margin:20px;background:rgb(255, 239, 186);\" *ngIf=\"work_assignment\" class=\"mat-elevation-z5\">\n    <p><em>The choice that counts</em> has randomly been selected to be:</p>\n    <div style=\"text-align:center\"><p><span class=\"mat-h2\">Choice {{work_assignment.choice_number+1}} made in week {{work_assignment.week}}</span></p></div>\n    <p>The allocation that you chose was:</p>\n        <div style=\"text-align:center\"><p><span class=\"mat-h2\">Week 2: {{work_assignment.choice}} pages<br>Week 3: \n            {{ (50 - work_assignment.choice) * work_assignment.exchange_rate }} pages</span></p></div>\n    <p *ngIf=\"user && user.role=='regulator'\">This is not including the minimal work of 10 pages per week. In week 3 the minimal work will be added to the work \n        task.</p>\n    <div *ngIf=\"user && user.role=='worker' && work_assignment\">\n        <p>The regulator set your minimal work in week 2 to be:</p>\n        <div style=\"text-align:center\"><span class=\"mat-h2\">{{ work_assignment.regulation_min }} pages.</span></div>\n        <p *ngIf=\"work_assignment.choice >= work_assignment.regulation_min\">The regulation does therefore not affect your allocation</p>\n        <p *ngIf=\"work_assignment.regulation_min > work_assignment.choice\">The regulation therefore changes your final allocation to:</p>\n        <div *ngIf=\"reg_binding\" style=\"text-align:center\"><p><span class=\"mat-h2\">Week 2: {{work_assignment.week2}} pages<br>Week 3: {{ work_assignment.week3 }} \n            pages</span></p></div>\n        <p *ngIf=\"work_assignment.regulation_min > work_assignment.choice\">This is not including the minimal work of 10 pages per week. In week 3 the minimal work \n            will be added to the work task.</p>\n    </div>\n</mat-card>\n");

